import logo from './logo.svg';
import './App.css';
import { BrowserRouter,Link,Route,Routes} from 'react-router-dom';
import Prueba from './componentes/Prueba';
import Pruebados from './componentes/Pruebados';
function App() {
  return (
    <BrowserRouter className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Link to='/p'>prueba</Link>
        <Link to='/c'>prueba</Link>
      </header>
      <Routes>
        <Route path='/p'>
          <h1>hola mundo 1</h1>
        </Route>
        <Route path='/c'>
        <h1>hola mundo 2</h1>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
